import ProductsLayout from "./ProductsLayout";
import "./ProductItems.css";

const productData = [
  {
    id: 1,
    item: "Graphic Card",
    price: "100$",
    detail: "this is product A and it is a multiple tasker",
  },
  {
    id: 2,
    item: "Pair of T-shirt",
    price: "500$",
    detail: "Product B, Only few avaliable",
  },
];

function ProductItems() {
  return (
    <section className="ProductItems">
      <ProductsLayout
        item={productData[0].item}
        price={productData[0].price}
      ></ProductsLayout>

      <ProductsLayout
        item={productData[1].item}
        price={productData[1].price}
      ></ProductsLayout>
    </section>
  );
}
export default ProductItems;
